import React from 'react' ;
import {Doughnut} from 'react-chartjs-2';




export const ShareofComment = () => {
    const data = {
        datasets: [{
            data: [300, 50, 100],
            backgroundColor: [
            '#FF6384',
            '#36A2EB',
            '#FFCE56'
            ],
            hoverBackgroundColor: [
            '#FF6384',
            '#36A2EB',
            '#FFCE56'
            ]
        }]
    };
    return (
        <div style={{marginTop:0}}>
            <h4 style={{fontWeight : "bold"}}>Share of Comments</h4>
            <Doughnut data={data} />
        </div>
    )
}
